import React, { useState } from 'react';
import { Card, Button, Accordion, Badge } from 'react-bootstrap';
import { ArrowLeft, Calendar3, List } from 'react-bootstrap-icons';

const SurveyResponses = ({ surveys, onBack }) => {
  const [expandedResponse, setExpandedResponse] = useState(null);
  const [view, setView] = useState('summary');

  const groupedResponses = surveys.reduce((groups, survey) => {
    const date = new Date(survey._submission_time).toLocaleDateString();
    if (!groups[date]) {
      groups[date] = [];
    }
    groups[date].push(survey);
    return groups;
  }, {});

  const renderValue = (value) => {
    if (value === null || value === undefined) {
      return 'No respondido';
    }
    if (typeof value === 'object' && !Array.isArray(value)) {
      return (
        <pre className="mb-0 bg-white p-2 rounded border">{JSON.stringify(value, null, 2)}</pre>
      );
    }
    if (Array.isArray(value)) {
      return value.join(', ');
    }
    return String(value);
  };

  const getBadgeVariant = (count) => {
    if (count > 10) return 'danger';
    if (count > 5) return 'warning';
    return 'primary';
  };

  const renderSummaryView = () => (
    <div className="d-flex flex-wrap gap-3">
      {Object.entries(groupedResponses).map(([date, responses]) => (
        <Card key={date} className="shadow-sm flex-grow-1" style={{ minWidth: '250px' }}>
          <Card.Body className="text-center">
            <Calendar3 className="mb-2 text-primary" size={32} />
            <h6 className="fw-bold">{date}</h6>
            <Badge bg={getBadgeVariant(responses.length)} className="mb-2">
              {responses.length} respuesta{responses.length !== 1 ? 's' : ''}
            </Badge>
            <Button 
              variant="outline-primary" 
              size="sm"
              onClick={() => {
                setView('detail');
                setExpandedResponse(date);
              }}
            >
              Ver respuestas
            </Button>
          </Card.Body>
        </Card>
      ))}
    </div>
  );

  const renderDetailView = () => (
    <div>
      <Button 
        variant="link" 
        className="text-decoration-none mb-3"
        onClick={() => {
          setView('summary');
          setExpandedResponse(null);
        }}
      >
        <ArrowLeft /> Volver al resumen
      </Button>

      <div className="mb-3">
        <h5>
          Respuestas del {expandedResponse}
          <Badge bg="primary" className="ms-2">
            {groupedResponses[expandedResponse]?.length || 0} respuestas
          </Badge>
        </h5>
      </div>

      <Accordion>
        {groupedResponses[expandedResponse]?.map((response, index) => (
          <Accordion.Item key={index} eventKey={index.toString()}>
            <Accordion.Header>
              <List className="me-2" /> Respuesta {index + 1}
            </Accordion.Header>
            <Accordion.Body className="bg-light p-3">
              <div className="response-details">
                {Object.entries(response)
                  .filter(([key]) => {
                    const excludedFields = [
                      'formhub/uuid', '_xform_id_string', '_uuid', '_attachments', 
                      '_status', '_geolocation', '_tags', '_notes', '_validation_status',
                      '_submitted_by', 'start', 'end', '__version__', 'meta/instanceID',
                      '_submission_time',
                    ];
                    return !excludedFields.includes(key);
                  })
                  .map(([key, value]) => (
                    <div key={key} className="mb-3 border-bottom pb-3">
                      <div className="fw-medium text-primary mb-2">
                        {key.startsWith('_') ? key.slice(1) : key}
                      </div>
                      <div className="ps-3">
                        {renderValue(value)}
                      </div>
                    </div>
                  ))}
              </div>
            </Accordion.Body>
          </Accordion.Item>
        ))}
      </Accordion>
    </div>
  );

  return (
    <div className="container py-4">
      <div className="mb-4">
        <Button 
          variant="link" 
          onClick={onBack}
          className="text-decoration-none p-0"
        >
          <ArrowLeft /> Volver a proyectos
        </Button>
        <h4 className="mt-3">Respuestas de la Encuesta</h4>
      </div>

      {view === 'summary' ? renderSummaryView() : renderDetailView()}
    </div>
  );
};

export default SurveyResponses;
